import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import { CssBaseline, Container, Paper, Card, Grid } from '@material-ui/core';

const useStyles = makeStyles(theme => ({
    root: {
      padding: theme.spacing(3, 2),
    },
  }));

export default function FormationCanvas(){


    return (
        <React.Fragment>
            <CssBaseline>
                <Container fixed>
                    <Grid spacing={2} justify="center">
                        <Paper>Stage</Paper>
                    </Grid>
                </Container>
            </CssBaseline>
        </React.Fragment>
    );
}
